    // Function to find and highlight census blocks
    function highlightCensusBlocks(blockIds) {
        console.log('Attempting to highlight blocks:', blockIds);
        var highlighted = 0;
        geoJsonLayers.forEach(function(layer) {
            if (layer.feature && layer.feature.properties) {
                var geoid = layer.feature.properties.GEOID;
                if (blockIds.includes(geoid)) {
                    layer.setStyle({
                        weight: 3,
                        color: '#ff0000',
                        fillOpacity: 0.9
                    });
                    highlighted++;

                    // Reset to default style
                    layer.setStyle({

                        color: '#000000',
                        fillOpacity: 0.7
                    });
                }
            }
        });
        console.log('Highlighted', highlighted, 'census blocks');
    }
    
    // Function to clear highlights
    function clearHighlights() {

        geoJsonLayers.forEach(function(layer) {
            if (layer.setStyle) {
                layer.setStyle({
                    weight: 0.25,
                    color: '#000000',
                    fillOpacity: 0.7
                });
            }
        });
        highlightedBlocks.clear();

                                geoJsonLayers.push(subLayer);
                            }

                    }

                                    className: 'custom-tooltip'
                                }

                type: 'censusBlockList',
                blocks: censusBlockData

        }, 1500);
